import { Routes, Route } from "react-router";
import { AuthPage } from './pages/AuthPage'
import { RegistrationPage } from './pages/RegistrationPage'
import { DevTypesPage } from './pages/DevTypesPage'
import { RequestPage } from './pages/RequestPage'
import { DevAboutPage } from './pages/DevAboutPage'
import { AdmPage } from './pages/AdmPage'
import { AdmAboutUserPage } from "./pages/AdmAboutUserPage";
import { AdmAboutEmployeePage } from "./pages/AdmAboutEmployeePage";
import { AdmAboutRequestPage } from "./pages/AdmAboutRequestPage";
import { AdminUserCreate } from "../components/Admin/Users/AdminUserCreate/AdminUserCreate";
import { AdminRequestCreate } from "../components/Admin/Requests/AdminRequestCreate/AdminRequestCreate";
import { AdminEmployeeCreate } from "../components/Admin/Employees/AdminEmployeeCreate/AdminEmployeeCreate";

export function App() {
    return (
        <Routes>
            {/* ===== Пользовательские страницы ===== */}
            <Route path="/">
                <Route index element={<DevTypesPage />} />                    {/* == Главная страница == */}
                <Route path="signin" element={<AuthPage />} />                {/* == Авторизация == */}
                <Route path="signup" element={<RegistrationPage />} />        {/* == Регистрация == */}
                <Route path="request" element={<RequestPage />} />            {/* == Страница заявки == */}
                <Route path="about/:id" element={<DevAboutPage />} />         {/* == Подробная информация == */}
            </Route>

            {/* ===== Админ-страницы ===== */}
            <Route path="/admin">
                <Route index element={<AdmPage />} />                         {/* == Админ-панель == */}
                <Route path="user">
                    <Route path=":id/*" element={<AdmAboutUserPage />} />     {/* == Просмотр пользователя == */}
                    <Route path="create" element={<AdminUserCreate />} />     {/* == Создание пользователя == */}
                </Route>
                <Route path="employee">
                    <Route path=":id/*" element={<AdmAboutEmployeePage />} /> {/* == Просмотр сотрудника == */}
                    <Route path="create" element={<AdminEmployeeCreate />} /> {/* == Создание сотрудника == */}
                </Route>
                <Route path="order">
                    <Route path=":id" element={<AdmAboutRequestPage />} />    {/* == Просмотр заказа == */}
                    <Route path="create" element={<AdminRequestCreate />} />  {/* == Создание заказа == */}
                </Route>
            </Route>
        </Routes>
    );
}
